package com.pandacreep.instagram.util;

import com.pandacreep.instagram.model.comment.CommentRepository;
import com.pandacreep.instagram.model.post.Post;
import com.pandacreep.instagram.model.post.PostRepository;
import com.pandacreep.instagram.model.user.User;
import com.pandacreep.instagram.model.user.UserRepository;
import com.pandacreep.instagram.model.user.UserService;
import lombok.AllArgsConstructor;
import org.springframework.boot.CommandLineRunner;
import org.springframework.context.annotation.Bean;
import org.springframework.context.annotation.Configuration;
import org.springframework.security.crypto.password.PasswordEncoder;

import java.time.LocalDateTime;
import java.util.ArrayList;
import java.util.List;
import java.util.UUID;
import java.util.stream.Stream;

@Configuration
@AllArgsConstructor
public class PreloadDatabaseWithData {
    UserRepository userRepository;
    UserService userService;
    PostRepository postRepository;
    CommentRepository commentRepository;
    PasswordEncoder encoder;

    @Bean
    CommandLineRunner initDatabase() {
        System.out.println("Initialization of MongoDB with initial data");
        userRepository.deleteAll();
        postRepository.deleteAll();
        commentRepository.deleteAll();
        try {
            initUsers().run();
            initPosts().run();
            initSubscriptions();
        } catch (Exception e) {
            e.printStackTrace();
        }
        return null;
    }

    public void initSubscriptions() {
        userService.subscribe("anna@gmail.com", "oleg@gmail.com");
        userService.subscribe("oleg@gmail.com", "mike@gmail.com");
        userService.subscribe("mike@gmail.com", "anna@gmail.com");
    }

    private CommandLineRunner initPosts() {
        return (args) -> {
            Post[] posts = posts();
            for (int i = 0; i < posts.length; i++) {
                postRepository.save(posts[i]);
                System.out.println(posts[i]);
                var userEmail = posts[i].getUser().getEmail();
                var user = userRepository.findByEmail(userEmail).get();
                List<Post> userPosts = user.getPosts();
                userPosts.add(posts[i]);
                user.setPosts(userPosts);
                userRepository.save(user);
            }
        };
    }

    private Post[] posts() {
        return new Post[]{
                new Post(UUID.randomUUID().toString(),
                        "",
                        "vacation",
                        LocalDateTime.now().minusDays(20),
                        users()[0],
                        new ArrayList<>(), new ArrayList<>()),
                new Post(UUID.randomUUID().toString(),
                        "",
                        "girl at beach",
                        LocalDateTime.now().minusDays(15),
                        users()[0],
                        new ArrayList<>(), new ArrayList<>()),
                new Post(UUID.randomUUID().toString(),
                        "",
                        "party",
                        LocalDateTime.now().minusDays(25),
                        users()[1],
                        new ArrayList<>(), new ArrayList<>()),
                new Post(UUID.randomUUID().toString(),
                        "",
                        "family",
                        LocalDateTime.now().minusDays(5),
                        users()[1],
                        new ArrayList<>(), new ArrayList<>()),
                new Post(UUID.randomUUID().toString(),
                        "",
                        "children",
                        LocalDateTime.now().minusDays(10),
                        users()[2],
                        new ArrayList<>(), new ArrayList<>()),
                new Post(UUID.randomUUID().toString(),
                        "",
                        "cook",
                        LocalDateTime.now().minusDays(11),
                        users()[2],
                        new ArrayList<>(), new ArrayList<>())
        };
    }

    private CommandLineRunner initUsers() {
        return (args) -> Stream.of(users())
                .peek(System.out::println)
                .forEach(userRepository::save);
    }

    private User[] users() {
        return new User[]{
                new User(UUID.randomUUID().toString(),
                        "anna@gmail.com", "Anna",
                        encoder.encode("123"),
                        "",
                        "Dancer", "7465", "F",
                        new ArrayList<>(), new ArrayList<>(), new ArrayList<>()),
                new User(UUID.randomUUID().toString(),
                        "oleg@gmail.com", "Oleg",
                        encoder.encode("123"),
                        "",
                        "Ironman", "5734", "M",
                        new ArrayList<>(), new ArrayList<>(), new ArrayList<>()),
                new User(UUID.randomUUID().toString(),
                        "mike@gmail.com", "Mike",
                        encoder.encode("123"),
                        "",
                        "Coder", "9374", "M",
                        new ArrayList<>(), new ArrayList<>(), new ArrayList<>())
        };
    }
}
